class Solution {
  int missingInteger(List<int> nums) {
    // No need to calculate arithmetic sum, logic simplified
    int maxLength = 0, maxSum = 0;
    int currentLength = 1, currentSum = nums[0];
    for (int i = 1; i < nums.length; i++) {
      if (nums[i] == nums[i - 1] + 1) {
        // Continuing the sequential prefix
        currentLength++;
        currentSum += nums[i];
      } else {
        // Not sequential, reset if new sequence starts
        if (nums[i] > nums[i - 1] + 1 || nums[i] <= nums[i - 1]) {
          if (currentLength > maxLength) {
            maxLength = currentLength;
            maxSum = currentSum;
          }
          currentLength = 1;
          currentSum = nums[i];
        }
      }
    }
    // Check last sequence
    if (currentLength > maxLength) {
      maxLength = currentLength;
      maxSum = currentSum;
    }

    int targetSum = maxSum + 1; // Start checking from just above the sum of the longest sequential prefix
    while (nums.contains(targetSum)) { // Find the missing integer
      targetSum++;
    }
    return targetSum;
  }
}
